{
    "sqlServerQuery": "SELECT min_latitude, min_longitude, max_latitude, max_longitude From marine_regions WHERE name = 'Atlantic Ocean' FOR JSON PATH",
    "outputType": "text",
    "responseText": "The maximum latitude of the Atlantic Ocean is {max_latitude}, and the minimum latitude is {min_latitude}. The maximum longitude of the Atlantic Ocean is {max_longitude}, and the minimum longitude is {min_longitude}."

}

{
    "sqlServerQuery": "SELECT i.urlSELECT TOP 10 i.url, i.id as image_id, b.concept, b.id, i.latitude, i.longitude FROM images i JOIN bounding_boxes b ON i.id = b.image_id JOIN marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude AND i.longitude BETWEEN mr.min_longitude AND mr.max_longitude WHERE b.concept = 'Aurelia aurita'     AND mr.name = 'Monterey Bay' FOR JSON PATH FROM images i JOIN bounding_boxes b ON i.id = b.image_id JOIN marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude WHERE b.concept = 'Aurelia aurita' AND mr.name = 'Pacific Ocean'",
    "outputType": "images",
    "responseText": "Here are 10 images of Aurelia Aurita in Monterey Bay"
}

{
    "sqlServerQuery": "SELECT TOP 10 i.url, i.id as image_id, b.concept, b.id, i.depth_meters FROM images i JOIN bounding_boxes b ON i.id = b.image_id JOIN marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude WHERE b.concept = 'Aurelia aurita'     AND mr.name = 'Monterey bay'     AND i.depth_meters < 5000 FOR JSON PATH",
    "outputType": "images",
    "responseText": "Here are some images of Aurelia Aurita"
}

{
    "sqlServerQuery": "SELECT TOP 10 r.name, COUNT(b.id) AS count FROM dbo.bounding_boxes b JOIN dbo.images i ON b.image_id = i.id JOIN dbo.marine_regions r ON i.latitude BETWEEN r.min_latitude AND r.max_latitude                   AND i.longitude BETWEEN r.min_longitude AND r.max_longitude WHERE b.concept = 'Aurelia aurita' GROUP BY r.name ORDER BY count DESC FOR JSON PATH",
    "outputType": "table",
    "responseText": "The table displays a list of places and the number of Aurelia Aurita found in each place"
}

{
    "sqlServerQuery": "SELECT b2.concept AS species, COUNT(*) AS frequency FROM dbo.bounding_boxes b1 JOIN dbo.bounding_boxes b2 ON b1.image_id = b2.image_id WHERE b1.concept = 'Aurelia aurita' AND b2.concept <> 'Aurelia aurita' GROUP BY b2.concept ORDER BY frequency DESC FOR JSON PATH;",
    "outputType": "table",
    "responseText": "Here is a table showing a species found near Aurelia Aurita and it's frequency"
}

{
    "sqlServerQuery": "WITH AureliaImages AS (  SELECT DISTINCT image_id  FROM dbo.bounding_boxes  WHERE concept = 'Aurelia aurita'),OtherSpeciesInAureliaImages AS (  SELECT DISTINCT bb1.image_id  FROM dbo.bounding_boxes AS bb1  JOIN dbo.bounding_boxes AS bb2 ON bb1.image_id = bb2.image_id  WHERE bb1.concept = 'Aurelia aurita' AND bb2.concept != 'Aurelia aurita')SELECT   COUNT(*) AS 'Frequency',  (SELECT COUNT(*) FROM AureliaImages) AS 'TotalAureliaImages'FROM OtherSpeciesInAureliaImages FOR JSON PATH;",
    "outputType": "table",
    "responseText": "The number of Aurelia Aurita images is {TotalAureliaImages}. Out of it {frequency} contain other species"
}

{{
    "vegaSchema": "{'$schema': 'https://vega.github.io/schema/vega-lite/v4.json','mark': 'bar','encoding': {    'x': {'field': 'OceanZone', 'type': 'nominal'},    'y': {'field': 'SpeciesCount', 'type': 'quantitative'}}}",
    "sqlServerQuery": "SELECT      CASE          WHEN i.depth_meters <= 200 THEN 'Epipelagic'         WHEN i.depth_meters > 200 AND i.depth_meters <= 1000 THEN 'Mesopelagic'         WHEN i.depth_meters > 1000 AND i.depth_meters <= 4000 THEN 'Bathypelagic'         WHEN i.depth_meters > 4000 THEN 'Abyssopelagic'     END AS OceanZone,     COUNT(b.concept) AS SpeciesCount FROM      dbo.images i JOIN      dbo.bounding_boxes b ON i.id = b.image_id JOIN      dbo.marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude                         AND i.longitude BETWEEN mr.min_longitude AND mr.max_longitude WHERE      mr.name = 'Monterey Bay' GROUP BY      CASE          WHEN i.depth_meters <= 200 THEN 'Epipelagic'         WHEN i.depth_meters > 200 AND i.depth_meters <= 1000 THEN 'Mesopelagic'         WHEN i.depth_meters > 1000 AND i.depth_meters <= 4000 THEN 'Bathypelagic'         WHEN i.depth_meters > 4000 THEN 'Abyssopelagic'     END ORDER BY OceanZone FOR JSON PATH",
    "outputType": "vegaLite",
    "responseText": "The table below displays the various depths and the corresponding distribution of Aurelia aurita at those depths."
}

{
    "sqlServerQuery": "WITH ImageConcepts AS ( SELECT TOP 1 i.id as image_id FROM dbo.images i WHERE      EXISTS (         SELECT 1         FROM dbo.bounding_boxes b         WHERE b.image_id = i.id AND b.concept = 'Aurelia aurita'     )     AND EXISTS (         SELECT 1         FROM dbo.bounding_boxes b         WHERE b.image_id = i.id AND b.concept = 'Siphonophorae'     ) GROUP BY i.id) SELECT      b.id,     b.concept,     i.url,     i.id as image_id,     b.x,     b.y,     b.width,     b.height FROM      dbo.images i JOIN      dbo.bounding_boxes b ON i.id = b.image_id JOIN      ImageConcepts c ON c.image_id = i.id WHERE      b.concept IN ('Aurelia aurita', 'Siphonophorae') FOR JSON PATH",
    "outputType": "images",
    "responseText": "Here are some images containing both Aurelia aurita and Siphonophorae"
}

{
    "sqlServerQuery": "SELECT b.concept AS species, COUNT(*) AS frequency FROM dbo.bounding_boxes AS b JOIN dbo.images AS i ON b.image_id = i.id WHERE i.depth_meters = 1000 GROUP BY b.concept ORDER BY frequency DESC FOR JSON PATH;",
    "outputType": "table",
    "responseText": "Here is a table with the species name and it's frequency"
}

{
    "sqlServerQuery": "SELECT COUNT(DISTINCT b.concept) as DistinctSpeciesCount FROM dbo.bounding_boxes b WHERE EXISTS (     SELECT 1     FROM dbo.images i     JOIN dbo.marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude                              AND i.longitude BETWEEN mr.min_longitude AND mr.max_longitude     WHERE mr.name = 'Monterey Bay'       AND i.id = b.image_id ) FOR JSON PATH",
    "outputType": "text",
    "responseText": "There are {DistinctSpeciesCount} distinct species at Monterey Bay"
}

{
    "sqlServerQuery": "SELECT TOP 10 i.url, b.concept, b.id, i.id as image_id FROM dbo.bounding_boxes AS b JOIN dbo.images AS i ON b.image_id = i.id WHERE b.concept = 'Aurelia aurita' ORDER BY (b.width * b.height) / (i.width * i.height) DESC FOR JSON PATH",
    "outputType": "images",
    "responseText": "Here are some good images of Aurelia Aurita"
}

