column3:
{
    "sqlServerQuery": "SELECT    b.concept,    b.id,    i.latitude,    i.longitude,    i.depth_metersFROM    dbo.bounding_boxes b    JOIN dbo.images i ON b.image_id = i.id    JOIN dbo.marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude        AND i.longitude BETWEEN mr.min_longitude AND mr.max_longitudeWHERE    mr.name = 'Monterey Bay'FOR JSON PATH",
    "outputType": "heatmap",
    "responseText": "Here is the heatmap of all species at Monterey Bay"
}

{
    "sqlServerQuery": "SELECT TOP 1 mr.name as region_name, COUNT(bb.id) as count FROM dbo.bounding_boxes bb JOIN dbo.images i ON bb.image_id = i.id JOIN dbo.marine_regions mr ON i.latitude BETWEEN mr.min_latitude AND mr.max_latitude AND i.longitude BETWEEN mr.min_longitude AND mr.max_longitude WHERE bb.concept = 'Aurelia aurita' GROUP BY mr.name ORDER BY count DESC FOR JSON PATH",
    "outputType": "text",
    "responseText": "Aurelia aurita is found the most in the region {region name} and it's count is {count}"
}

{
    "sqlServerQuery": "WITH SalinityLevels AS (     SELECT '<32' AS salinity_level     UNION ALL     SELECT '32-33'     UNION ALL     SELECT '33-34'     UNION ALL     SELECT '34-35'     UNION ALL     SELECT '35-36'     UNION ALL     SELECT '36-37'     UNION ALL     SELECT '>37' ), AggregatedData AS (     SELECT          CASE              WHEN images.salinity < 32 THEN '<32'             WHEN images.salinity BETWEEN 32 AND 33 THEN '32-33'             WHEN images.salinity BETWEEN 33 AND 34 THEN '33-34'             WHEN images.salinity BETWEEN 34 AND 35 THEN '34-35'             WHEN images.salinity BETWEEN 35 AND 36 THEN '35-36'             WHEN images.salinity BETWEEN 36 AND 37 THEN '36-37'             WHEN images.salinity > 37 THEN '>37'         END AS salinity_level,         COUNT(bounding_boxes.concept) AS species_count     FROM          dbo.images     JOIN          dbo.bounding_boxes ON images.id = bounding_boxes.image_id     WHERE          bounding_boxes.concept = 'Aurelia aurita'     AND          images.salinity IS NOT NULL     GROUP BY          CASE              WHEN images.salinity < 32 THEN '<32'             WHEN images.salinity BETWEEN 32 AND 33 THEN '32-33'             WHEN images.salinity BETWEEN 33 AND 34 THEN '33-34'             WHEN images.salinity BETWEEN 34 AND 35 THEN '34-35'             WHEN images.salinity BETWEEN 35 AND 36 THEN '35-36'             WHEN images.salinity BETWEEN 36 AND 37 THEN '36-37'             WHEN images.salinity > 37 THEN '>37'         END ) SELECT      sl.salinity_level,     COALESCE(ad.species_count, 0) AS species_count FROM      SalinityLevels sl LEFT JOIN      AggregatedData ad ON sl.salinity_level = ad.salinity_level ORDER BY      salinity_level FOR JSON PATH;",
    "outputType": "table",
    "responseText": "The table below shows the salinity levels and the distribution of Aurelia aurita"
}

{
    "sqlServerQuery": "WITH DepthLevels AS (    SELECT 'Epipelagic (0-200m)' AS depth_level, 0 AS min_depth, 200 AS max_depth    UNION ALL    SELECT 'Mesopelagic (200-1000m)', 200, 1000    UNION ALL    SELECT 'Bathypelagic (1000-4000m)', 1000, 4000    UNION ALL    SELECT 'Abyssopelagic (4000-6000m)', 4000, 6000    UNION ALL    SELECT 'Hadalpelagic (>6000m)', 6001, 1000000  -- assuming a large max value to capture everything > 6000),AggregatedData AS (    SELECT         CASE             WHEN images.depth_meters BETWEEN 0 AND 200 THEN 'Epipelagic (0-200m)'            WHEN images.depth_meters BETWEEN 200 AND 1000 THEN 'Mesopelagic (200-1000m)'            WHEN images.depth_meters BETWEEN 1000 AND 4000 THEN 'Bathypelagic (1000-4000m)'            WHEN images.depth_meters BETWEEN 4000 AND 6000 THEN 'Abyssopelagic (4000-6000m)'            WHEN images.depth_meters > 6000 THEN 'Hadalpelagic (>6000m)'        END AS depth_level,        COUNT(bounding_boxes.id) AS distribution    FROM         images     JOIN         bounding_boxes     ON         images.id = bounding_boxes.image_id    WHERE         bounding_boxes.concept = 'Aurelia aurita'    AND         images.depth_meters IS NOT NULL    GROUP BY         CASE             WHEN images.depth_meters BETWEEN 0 AND 200 THEN 'Epipelagic (0-200m)'            WHEN images.depth_meters BETWEEN 200 AND 1000 THEN 'Mesopelagic (200-1000m)'            WHEN images.depth_meters BETWEEN 1000 AND 4000 THEN 'Bathypelagic (1000-4000m)'            WHEN images.depth_meters BETWEEN 4000 AND 6000 THEN 'Abyssopelagic (4000-6000m)'            WHEN images.depth_meters > 6000 THEN 'Hadalpelagic (>6000m)'        END)SELECT     dl.depth_level,     COALESCE(ad.distribution, 0) AS distributionFROM     DepthLevels dlLEFT JOIN     AggregatedData ad ON dl.depth_level = ad.depth_levelORDER BY     dl.min_depth FOR JSON PATH;",
    "outputType": "table",
    "responseText": "The table below displays the various depths and the corresponding distribution of Aurelia aurita at those depths."
}

{
    "sqlServerQuery": "WITH RegionAvgTemp AS (     SELECT          r.name as region_name,         AVG(i.temperature_celsius) as avg_temperature     FROM dbo.images i     JOIN dbo.marine_regions r ON          i.latitude BETWEEN r.min_latitude AND r.max_latitude AND         i.longitude BETWEEN r.min_longitude AND r.max_longitude     GROUP BY r.name ), MaxTempRegion AS (     SELECT TOP 1 region_name, avg_temperature     FROM RegionAvgTemp     ORDER BY avg_temperature ASC ), MostFoundSpecies AS (     SELECT          b.concept,          COUNT(*) as count     FROM dbo.bounding_boxes b     JOIN dbo.images i ON b.image_id = i.id     JOIN dbo.marine_regions r ON          i.latitude BETWEEN r.min_latitude AND r.max_latitude AND         i.longitude BETWEEN r.min_longitude AND r.max_longitude     JOIN MaxTempRegion m ON r.name = m.region_name     GROUP BY b.concept ) SELECT TOP 1 bb.id, mfs.concept, mfs.count, mtr.avg_temperature, mtr.region_name FROM MostFoundSpecies mfs JOIN dbo.bounding_boxes bb ON bb.concept = mfs.concept JOIN MaxTempRegion mtr ON 1=1 ORDER BY mfs.count ASC FOR JSON PATH;",
    "outputType": "table",
    "responseText": "The table below displays the various depths and the corresponding distribution of Aurelia aurita at those depths."
}

{
    "sqlServerQuery": "SELECT b.concept, b.id, i.id as image_id, i.url as url FROM dbo.bounding_boxes AS b JOIN dbo.images AS i ON b.image_id = i.id WHERE b.image_id = 2256720 FOR JSON PATH;",
    "outputType": "species",
    "responseText": "The species that are found in image with id 2256720 are shown below"
}

{
    "sqlServerQuery": "SELECT concept, id FROM dbo.bounding_boxes  WHERE id = 2258719 FOR JSON PATH;",
    "outputType": "species",
    "responseText": "The species with bounding box id 2258719 is shown below"
}

{
    "sqlServerQuery": "WITH HighestConcentrationImage AS (    SELECT TOP 1        i.id as image_id,        COUNT(b.id) as concentration    FROM        dbo.images i    JOIN        dbo.bounding_boxes b ON i.id = b.image_id    WHERE        b.concept = 'Bathochordaeus stygius' OR b.alt_concept = 'Bathochordaeus stygius'    GROUP BY        i.id    ORDER BY        concentration DESC)SELECT     b.id,    b.concept,    i.url,    i.id as image_id,    b.x,    b.y,    b.width,    b.heightFROM     dbo.images iJOIN     dbo.bounding_boxes b ON i.id = b.image_idJOIN     HighestConcentrationImage hci ON hci.image_id = i.idWHERE     b.concept = 'Bathochordaeus stygius'FOR JSON PATH",
    "outputType": "images",
    "responseText": "Here are some images showcasing the highest concentration of Bathochordaeus stygius"
}

{
    "sqlServerQuery": "SELECT images.pressure_dbar FROM dbo.bounding_boxes JOIN dbo.images ON bounding_boxes.image_id = images.id WHERE bounding_boxes.id = 2258739 FOR JSON PATH",
    "outputType": "text",
    "responseText": "The species with bounding box id 2258729 living at pressure {pressure_dbar} dbar"
}

{
    "vegaSchema": "{    '$schema': 'https://vega.github.io/schema/vega-lite/v4.json',    'description': 'A pie chart showing the correlation between salinity levels and the distribution of Bathochordaeus stygius.',    'mark': 'arc',    'encoding': {        'theta': {'field': 'count', 'type': 'quantitative'},        'color': {'field': 'salinity_range', 'type': 'nominal'}    }}",
    "sqlServerQuery": "SELECT      CASE          WHEN salinity >= 30 AND salinity < 31 THEN '30-31'         WHEN salinity >= 31 AND salinity < 32 THEN '31-32'         WHEN salinity >= 32 AND salinity < 33 THEN '32-33'         WHEN salinity >= 33 AND salinity < 34 THEN '33-34'         WHEN salinity >= 34 AND salinity < 35 THEN '34-35'         WHEN salinity >= 35 AND salinity < 36 THEN '35-36'         WHEN salinity >= 36 AND salinity < 37 THEN '36-37'         WHEN salinity >= 37 AND salinity < 38 THEN '37-38'     END AS salinity_range,     COUNT(*) AS count FROM      dbo.images AS i JOIN      dbo.bounding_boxes AS b ON i.id = b.image_id WHERE      b.concept = 'Bathochordaeus stygius'     AND salinity >= 30 AND salinity < 38 GROUP BY      CASE          WHEN salinity >= 30 AND salinity < 31 THEN '30-31'         WHEN salinity >= 31 AND salinity < 32 THEN '31-32'         WHEN salinity >= 32 AND salinity < 33 THEN '32-33'         WHEN salinity >= 33 AND salinity < 34 THEN '33-34'         WHEN salinity >= 34 AND salinity < 35 THEN '34-35'         WHEN salinity >= 35 AND salinity < 36 THEN '35-36'         WHEN salinity >= 36 AND salinity < 37 THEN '36-37'         WHEN salinity >= 37 AND salinity < 38 THEN '37-38'     END ORDER BY      salinity_range FOR JSON PATH;",
    "outputType": "vegaLite",
    "responseText": "The table below displays the various depths and the corresponding distribution of Aurelia aurita at those depths."
}

{
    "sqlServerQuery": "SELECT TOP 5    i.url AS url,    b.concept AS concept,    b.id as id,    b.image_id as image_idFROM     dbo.bounding_boxes AS bJOIN     dbo.images AS i ON b.image_id = i.idWHERE     b.concept IN ('Asterias rubens', 'Acanthaster planci', 'Linckia laevigata', 'Protoreaster nodosus', 'Pycnopodia helianthoides')FOR JSON PATH",
    "outputType": "images",
    "responseText": "Here are few images of Asterias rubens, Acanthaster planci, Linckia laevigata, Protoreaster nodosus, Pycnopodia helianthoides"
}

{
    "outputType": "vegaLite",
    "vegaSchema": {
        "$schema": "https://vega.github.io/schema/vega-lite/v4.json",
        "description": "Scatterplot showing depth to oxygen level data for Strongylocentrotus fragilis in Monterey Bay",
        "mark": "point",
        "encoding": {
            "x": {"field": "depth", "type": "quantitative"},
            "y": {"field": "oxygen", "type": "quantitative"}
        }
    },
    "responseText": "",
    "sqlServerQuery": "SELECT images.depth_meters AS depth, images.oxygen_ml_l AS oxygen FROM images JOIN bounding_boxes ON images.id = bounding_boxes.image_id WHERE bounding_boxes.concept = 'Strongylocentrotus fragilis' AND images.latitude >= (SELECT min_latitude FROM marine_regions WHERE name = 'Monterey Bay') AND images.latitude <= (SELECT max_latitude FROM marine_regions WHERE name = 'Monterey Bay') AND images.longitude >= (SELECT min_longitude FROM marine_regions WHERE name = 'Monterey Bay') AND images.longitude <= (SELECT max_longitude FROM marine_regions WHERE name = 'Monterey Bay') FOR JSON PATH"
}

{
    "sqlServerQuery": "SELECT COUNT(*) as TotalImages FROM dbo.bounding_boxes  WHERE concept = 'Pycnopodia helianthoides' FOR JSON PATH;",
    "outputType": "text",
    "responseText": "There are {TotalImages} images of Pycnopodia helianthoides are in the database"
}

{
    "sqlServerQuery": "WITH ImageConcepts AS (     SELECT TOP 5 i.id as image_id     FROM dbo.images i     JOIN dbo.bounding_boxes b ON i.id = b.image_id     WHERE b.concept IN ('Aurelia aurita', 'Chrysaora fuscescens', 'Siphonophorae')     GROUP BY i.id     HAVING COUNT(DISTINCT b.concept) = 3 ) SELECT      b.id,     b.concept,     i.url,     i.id as image_id,     b.x,     b.y,     b.width,     b.height FROM      dbo.images i JOIN      dbo.bounding_boxes b ON i.id = b.image_id JOIN      ImageConcepts c ON c.image_id = i.id WHERE      b.concept IN ('Aurelia aurita', 'Chrysaora fuscescens', 'Siphonophorae') FOR JSON PATH",
    "outputType": "images",
    "responseText": "Here are some images that has Acanthaster planci, Chrysaora fuscescens and Siphonophorae"
}

{
    "outputType": "vegaLite",
    "responseText": "A bar chart showing the year the images were taken",
    "vegaSchema": {
        "$schema": "https://vega.github.io/schema/vega-lite/v4.json",
        "mark": "bar",
        "encoding": {
            "x": {"field": "Year", "type": "ordinal"},
            "y": {"field": "ImageCount", "type": "quantitative"}
        }
    },
    "sqlServerQuery": "SELECT YEAR([timestamp]) AS Year, COUNT(*) AS ImageCount FROM dbo.images GROUP BY YEAR([timestamp]) ORDER BY Year; data: {"message": "Formatting response"}"
